So, I have decided to start myself a journal.

It sounds quite silly but I’m hoping it’s something that will help me with my mental struggles.

I tend to overthink and have lots going on inside my head; resulting in not sleeping, over eating & seriously bad mood swings.

The steps I have taken to change this lifestyle are small but hopefully quite big at the same time.

I’d personally like to thank @selfcare_chronicles__ for this fantastic idea❤️
But, if it weren’t for @mylittle_lifex, I would never have known about this🤍

I’ll keep you all updated on how it goes. Myself & Gabby (@myflat5) have started this journey together and I’m super excited to see how much it helps us!

✨I hope you all have a great Friday evening✨
