This momentary pause whistles like a warm breeze in my minds eye. 
I wonder what next I’ll see, 
what this life will bring me. 
This time our world pushes in, 
demanding that look I around and do and do and do, but...
..unable to help but feel lost at times, 
I get worn down by exhaustion. 
But in the next second, 
there come gentle whispers within with voices familiar, so familiar, but un-nameable. 
...don’t fight.
...surrender to what is. 
