So ihr Lieben, ich fange dann mal an.
Ich habe jetzt eine Stunde in mein Journal geschrieben und überlegt wie es mir grad geht und woran ich arbeiten möchte. Was meine Ziele sind und wie der Weg dahin aussehen muss/kann/sollte. Zusammenfassend: Mein Leben ist echt schön. Es gibt so viele wundervolle Dinge in meinem Leben. Was mich aber nicht glücklich macht ist mein Verhältnis zu mir selbst. Ich definiere mich seit jeher über mein Äußeres. Gewicht, Kleidung, Schminke, Haare,... Meinen Charakter find ich ehrlich gesagt ziemlich super und will daran nichts ändern. Aber das Optische. Grad ist ja so viel in den Medien, dass man sich annehmen soll wie man ist und so... Aber so war ich nie. Ich will das auch nicht. Ich Will etwas ändern. Ich möchte in den Spiegel sehen und nicht nur mein Inneres , sondern auch das Äußere lieben. Mein größter Kritikpunkt an mir selbst ist mein Gewicht. Nach wie vor. Schon immer. Wie ich das nun, mal wieder, angehe? Ich gehe jeden Tag spazieren und trinke mehr Wasser und Tee (ich sage bewusst nicht 2l oder so). Ausserdem möchte ich jeden 2. Tag auf Süßigkeiten verzichten. Kleine Schritte. Wenn das klappt... Sehen wir weiter.
