.
"PEOPLE BLAME THE PEOPLE WHO REMIND THEM OF THE PERSON WHO HURT THEM"
.
I was thinking about the idea of how we (can't exclude anyone here), as humans, blame groups of people , blame everyone who reminds us of someone who angers us. 
.
I hold on to anger and it's wrong. None of us should. 

.
.
.

